//===============   [Funes]   ==================//


void heapsort(int* array,int size) {

	maxheap(array,size);
	sort(array,size);
	return;
}


void maxheap(int* array,int size) {

	for(int i = (size/2)-1; i != -1; i--)
		heapify(array,size,i);
	return;
}


void heapify(int* array,int size,int index) {

	int parent = index;
	int left = 2 * index+1;
	int right = 2 * index+2;

	if(left < size)
		if(array[left] > array[parent])
			parent = left;

	if(right < size)
		if(array[right] > array[parent])
			parent = right;

	if(index != parent) { 
		swap(&array[index],&array[parent]);
		heapify(array,size,parent);
	}
	return;
}


void swap(int* v1,int* v2) {

	int aux = *v1;
	*v1 = *v2; 
	*v2 = aux;

	return;
}


void sort(int* array,int size) {

	for(int i=size-1; i != -1; i--) {
		swap(&array[0],&array[i]);
		heapify(array,i,0);
	}

	return;
}


void printArray(int* array,int len) {

	for(int i = 0;i < len;i++)
		printf("%d ",array[i]);
	printf("\n");

	return;
}

void printTempo(double time_spent,clock_t begin,clock_t end) {

	time_spent += (double)(end-begin)/ CLOCKS_PER_SEC;

	printf("Time: %f\n",time_spent);

}